description.narrative:
The Universal Periodic Review (UPR) is a unique mechanism of the Human Rights Council (HRC) aimed at improving the human rights situation on the ground of each of the 193 United Nations (UN) member states and consists of a process through which the human rights records of member states of the UN are peer reviewed and assessed. However, due to financial, human resource and technical constraints, small states in particular, have challenges in developing and submitting their national reports; without permanent representation in Geneva, navigating the Geneva multilateral human rights landscape and making presentations before the Human Rights Council. This project therefore aims to: 
support member states to engage constructively and impactfully with the UPR mechanism and process; 
assist member states to set up and train national monitoring mechanisms for follow-up and implementation of international obligations; 
provide technical assistance for implementation of accepted recommendations at the national level.

The project also includes work at the Pan-Commonwealth level in regard to UPR recommendations on human rights issues of particular salience across the Commonwealth, for example those regarding child, early and forced marriage (CEFM); equality and non-discrimination; post-conflict reconciliation and healing; torture prevention and prohibition; human rights education (HRE) of a number of stakeholders such as judiciaries, parliaments and schools. 

The project also includes technical assistance to member states to implement accepted UPR recommendations as well as recommendations relating to mandates from Commonwealth Heads of Government, such as those relating to freedom of expression, association and peaceful assembly; freedom of religion or belief.
